import Repository from "./repository";

class UserRepository {
    //gell all clients
    async AddClients(payload) {
  
      const response = await Repository.post('/register',payload)
      .then((response) => {
        return response;
      })
      .catch((error) => {
        console.log(error);
        return error;
      });
    return response;
  }
    }
  

  export default new UserRepository();
